import React from 'react';
import { useLocation } from 'react-router-dom';

const Scorepage = () => {
    const location = useLocation();
    const { score, } = location.state; // Extract state from location

   

    return (
        <>
             <div style={{background:'blue',height:'600px',width:'60%',marginTop:'150px',marginLeft:'500px'}}>
            
            <h1 className='text-8xl pt-36' style={{textAlign:'center'}}>{score}</h1>
            <h1 className='text-7xl' style={{textAlign:'center'}}>Your Score</h1>
           
            
        </div>
        </>
   
    );
};

export default Scorepage;
